import Box from '@mui/material/Box';
import Stack from '@mui/material/Stack';


function Item(props){
    return(
        <Box>
            {props.children}
        </Box>
    );
}
export default function Dashboard() {
    return (
      <Stack spacing={2}>
        <Item>Item 1</Item>
        {/* You can add more items here */}
      </Stack>
    );
  }
